let cps = 0;
let intervalId = null;

onmessage = function(e) {
  if (e.data === "start") {
    intervalId = setInterval(function() {
      postMessage(cps);
      cps++;
    }, 1000);
  } else if (e.data === "stop") {
    clearInterval(intervalId);
  } else if (typeof e.data === "number") {
    cps = e.data;
  }
}
